export default function formationId(index) {
    switch (index) {
        case 0:
            return "Grandes Cultures";
        case 1:
            return "Verger";
        case 2:
            return "Bovin Viande";
        case 3:
            return "Viticulture";
        case 4:
            return "Bovin Laitier";
        case 5:
            return "Granivore";
        default:
            return "";
    }
}
